tables.table_schema:
CREATE TABLE property_data ( 
    property_id INT PRIMARY KEY, 
    property_type TEXT, 
    address TEXT, 
    market_value DECIMAL 
);

CREATE TABLE residential_properties (
  property_id UUID PRIMARY KEY,
  property_name VARCHAR(255) NOT NULL,
  property_type ENUM('residential') NOT NULL,
  property_size INT NOT NULL
);

CREATE TABLE commercial_properties (
  property_id UUID PRIMARY KEY,
  property_name VARCHAR(255) NOT NULL,
  property_type ENUM('commercial') NOT NULL,
  property_size INT NOT NULL
);

CREATE TABLE residential_properties (
    id INT PRIMARY KEY,
    address VARCHAR(255),
    bedrooms INT,
    bathrooms INT
);

CREATE TABLE commercial_properties (
    id INT PRIMARY KEY,
    address VARCHAR(255),
    square_feet INT,
    rent_per_month DECIMAL(10, 2)
);

CREATE TABLE industrial_properties (
    id INT PRIMARY KEY,
    address VARCHAR(255),
    size_in_acres DECIMAL(10, 2),
    factory_type VARCHAR(100)
);

CREATE TABLE property_owners (
    id INT PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(255),
    property_type VARCHAR(20)
);

